tables.table_schema:
CREATE TABLE machine_learning_models (
  model_id INT PRIMARY KEY,
  model_name VARCHAR(50) NOT NULL,
  model_version INT NOT NULL,
  model_path TEXT NOT NULL
);

CREATE TABLE deployments (
  deployment_id INT PRIMARY KEY,
  model_id INT REFERENCES machine_learning_models(model_id),
  deployment_date TIMESTAMP NOT NULL
);

CREATE TABLE users (
  user_id INT PRIMARY KEY,
  username VARCHAR(50) NOT NULL,
  email VARCHAR(100) NOT NULL,
  registration_date TIMESTAMP NOT NULL
);

CREATE TABLE MachineLearningModels (
    model_id SERIAL PRIMARY KEY,
    model_name VARCHAR(100) NOT NULL,
    model_type VARCHAR(50) NOT NULL,
    trained_accuracy FLOAT NOT NULL
);

CREATE TABLE Predictions (
    prediction_id SERIAL PRIMARY KEY,
    deployment_id INT NOT NULL,
    predicted_value FLOAT NOT NULL,
    prediction_date TIMESTAMP NOT NULL
);

CREATE TABLE EndUsers (
    user_id SERIAL PRIMARY KEY,
    user_name VARCHAR(100) NOT NULL,
    user_email VARCHAR(100) NOT NULL
);
